import { t as tracing } from '../../_virtual/tracing.js';
import './cjs/scheduler-tracing.production.min.js';
import './cjs/scheduler-tracing.development.js';
import { __exports as schedulerTracing_production_min } from '../../_virtual/scheduler-tracing.production.min.js';
import { __exports as schedulerTracing_development } from '../../_virtual/scheduler-tracing.development.js';

if (process.env.NODE_ENV === 'production') {
  tracing.exports = schedulerTracing_production_min;
} else {
  tracing.exports = schedulerTracing_development;
}
